const EVENTS = [
    {id:'e1', title: 'Event 1'},
    {id:'e2', title: 'Event 2'},
    {id:'e3', title: 'Event 3'},
    {id:'e4', title: 'Event 4'},
]
const EventsPage = () => {
    return (
        <>
        <ul>
            {EVENTS.map(event => <li>{event.title}</li>)}
        </ul>
        </>
    )
};

export default EventsPage;
